import React from "react";
import { NavLink} from "react-router-dom";

const Navigation = () => {
  return (
    <div className="navigation">
        <ul>
            <NavLink to="/" className={(nav) => (nav.isActive)}>
                <li>acceuil</li>
            </NavLink>
            <NavLink to="/about">
                <li>a propos</li>
            </NavLink>
        </ul>
    </div>
  );
}; 

export default Navigation;
